import React from 'react'

const BlogForm = ({ 
    onSubmit, 
    handleTitleChange, 
    handleAuthorChange,
    handleUrlChange,
    title,
    author,
    url 
}) => {
    return (
        <div>
            <form onSubmit={onSubmit} >
                <div>
                <input 
                value={title}
                onChange={handleTitleChange}
                />
                <button type="submit" >save</button>
                </div>
                <div>
                <input 
                value={author}
                onChange={handleAuthorChange}
                />
                </div>
                <div>
                <input 
                value={url}
                onChange={handleUrlChange}
                />
                </div>
            </form>
        </div>
    )
}

export default BlogForm
